import React from "react";






function Daily(props){
    return (
        <div className="daily">
        <h4 className="font">MONDAY</h4>
        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pngall.com%2Fweather-png%2Fdownload%2F90267&psig=AOvVaw2-rxIQ_hau6zdFuuqovLAS&ust=1648825692970000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCODvjsDQ8PYCFQAAAAAdAAAAABAD"></img>
        
       

        </div>

    );


}
export default Daily;
